import React from "react";
import { Link } from "react-router-dom";
import Clouds from "./Clouds";

const LandingPage = () => (
  <div className="text-hot-red max-h-screen absolute inset-0 flex flex-col items-center justify-center gap-10 landing-page-font">
    <Clouds numberOfClouds={7} />
    <Link to="/">
      <h1 className="text-6xl text-sm:text-4xl">Nika Darab</h1>
    </Link>
    <Link to="/software-engineer">
      <h2 className="text-4xl text-sm:text-2xl">Software Engineer</h2>
    </Link>

    <h2 className="text-4xl text-sm:text-2xl">Story Teller</h2>
  </div>
);
export default LandingPage;
